The Story : Teen Maar is the remake of hindi blockbuster movie &quot;Love Aaj Kal&quot;, in which Pawan Kalyan will be seen in dual roles as Arjun Palwai and Michael Velayudham in this romantic Comedy entertainer and the beautiful ladies Trisha and Kruthi Kharbanda are pairing up with the Power Star.

Directed by Jayant.C.Paranji and produced by Ganesh Babu under Parameshwara Arts, Teenmaar has dialogues by Trivikram and music by Mani Sharma. 


Release Date: 14 Apr 2011
Genre: Romance
Language: Telugu
Certification: U/A


